CREATE DEFINER=`root`@`localhost` PROCEDURE `cf_add_index_if_not_exists` (IN `p_schema` VARCHAR(64), IN `p_table` VARCHAR(64), IN `p_index` VARCHAR(64), IN `p_cols` VARCHAR(255))   BEGIN
    IF NOT EXISTS (
        SELECT 1
        FROM information_schema.statistics
        WHERE table_schema = p_schema
          AND table_name   = p_table
          AND index_name   = p_index
        LIMIT 1
    ) THEN
        SET @sql := CONCAT('ALTER TABLE `', p_schema, '`.`', p_table, '` ADD INDEX `', p_index, '` (', p_cols, ')');
        PREPARE stmt FROM @sql; EXECUTE stmt; DEALLOCATE PREPARE stmt;
    END IF;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_bafi_control_record` (IN `p_total_rows` INT)   BEGIN
  DECLARE v_bureau VARCHAR(20);
  SELECT bureau_number INTO v_bureau FROM agency_settings WHERE id = 1;

  SELECT LEFT(RPAD(CONCAT(
           /* 01-02 */ fn_num_pad('50', 2),
           /* 03-12 */ fn_num_pad(v_bureau, 10),
           /* 13-14 */ fn_num_pad('09', 2),
           /* 15-16 */ fn_num_pad('99', 2),        -- רשומת בקרה
           /* 17-20 */ fn_num_pad(CAST(p_total_rows AS CHAR), 4)
           /* 21-705 */ -- ריפוד עד 705
         ), 705, ' '), 705) AS control_line_705;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_bafi_data_line_for_employee` (IN `p_employee_id` BIGINT UNSIGNED, IN `p_record_type` CHAR(2), IN `p_mana_type` CHAR(2), IN `p_status_code` CHAR(2), IN `p_status_date` CHAR(8))   BEGIN
  /*
    מייצר שורת BAFI באורך 705 תווים עבור עובד.
    לוגיקה לבחירת שיבוץ:
      1) שיבוץ פעיל לפי תאריכים.
      2) אם אין פעיל – בוחרים את האחרון לפי end_date NULL->'9999-12-31', ואז id.
    הערות:
      - שימוש בפונקציות העזר הקיימות: fn_num_pad, fn_str_l, fn_str_r, fn_digits_only.
      - שדות בעברית מיושרים לימין (fn_str_r), לועזיים לשמאל (fn_str_l).
      - אם אין לעובד שיבוצים – לא תחזור רשומה (כמו במקור).
  */

  WITH placements_ranked AS (
    SELECT
      p.*,
      CASE WHEN p.start_date <= CURDATE()
            AND (p.end_date IS NULL OR p.end_date >= CURDATE())
           THEN 1 ELSE 0 END AS is_active
    FROM placements p
    WHERE p.employee_id = p_employee_id
  ),
  chosen AS (
    SELECT *
    FROM placements_ranked
    ORDER BY is_active DESC,
             COALESCE(end_date, '9999-12-31') DESC,
             id DESC
    LIMIT 1
  )
  SELECT
    -- משאב יחיד: מחזירים מחרוזת אחת בשם data_line
    LEFT(RPAD(CONCAT(
      /*  01-02 */ fn_num_pad('50', 2),                                  -- סוג קובץ
      /*  03-12 */ fn_num_pad(s.bureau_number, 10),                       -- מספר לשכה
      /* 13-14 */ fn_num_pad('09', 2),                                    -- ענף
      /* 15-16 */ fn_num_pad(p_record_type, 2),                           -- סוג רשומה
      /* 17-18 */ fn_num_pad(p_mana_type, 2),                             -- סוג מנה

      /* פרטי עובד */
      /* 19-21 */ fn_num_pad(CAST(COALESCE(e.country_symbol_moi, e.country_of_citizenship) AS CHAR), 3),
      /* 22-36 */ fn_str_l(e.passport_number, 15),
      /* 37-56 */ fn_str_l(e.last_name, 20),                              -- לועזי
      /* 57-76 */ fn_str_l(e.first_name, 20),                             -- לועזי
      /* 77-96 */ fn_str_l(e.father_name_en, 20),                         -- לועזי
      /* 97-116*/ fn_str_r(e.last_name_he, 20),                           -- עברית (ימין)
      /* 117-136*/ fn_str_r(e.first_name_he, 20),                         -- עברית (ימין)
      /* 137   */ fn_num_pad(CAST(e.gender_code AS CHAR), 1),
      /* 138-145*/ fn_num_pad(DATE_FORMAT(e.birth_date, '%Y%m%d'), 8),
      /* 146   */ fn_num_pad(CAST(e.marital_status_code AS CHAR), 1),
      /* 147-150*/ fn_str_l(e.phone_prefix_il, 4),
      /* 151-159*/ fn_str_l(e.phone_number_il, 9),

      /* סטטוס דיווח */
      /* 160-161*/ fn_num_pad(p_status_code, 2),
      /* 162-169*/ fn_num_pad(p_status_date, 8),

      /* פרטי מעסיק – מתוך השיבוץ הנבחר */
      /* 170   */ fn_num_pad(CAST(r.id_type_code AS CHAR), 1),
      /* 171-179*/ fn_num_pad(r.id_number, 9),
      /* 180-194*/ fn_str_l(r.passport_number, 15),
      /* 195-214*/ fn_str_l(r.last_name, 20),
      /* 215-234*/ fn_str_l(r.first_name, 20),
      /* 235   */ fn_num_pad(CAST(r.gender_code AS CHAR), 1),
      /* 236-239*/ fn_num_pad(CAST(r.birth_year AS CHAR), 4),

      /* כתובת/טלפון מעסיק */
      /* 240-243*/ fn_num_pad(CAST(r.city_code AS CHAR), 4),
      /* 244-273*/ fn_str_l('', 30),                                      -- שם יישוב (אופציונלי)
      /* 274-293*/ fn_str_l('', 20),                                      -- שם רחוב (אופציונלי)
      /* 294-299*/ fn_str_l(r.house_no, 6),
      /* 300-304*/ fn_num_pad(r.zipcode, 5),
      /* 305-314*/ fn_str_l(COALESCE(r.phone_number_il, fn_digits_only(r.phone)), 10),

      /* מייל עובד */
      /* 315-354*/ fn_str_l(e.email, 40),

      /* כתובת עובד בחו"ל */
      /* 355-384*/ fn_str_l(e.abroad_city, 30),
      /* 385-414*/ fn_str_l(e.abroad_street, 30),
      /* 415-420*/ fn_str_l(e.abroad_house_no, 6),
      /* 421-430*/ fn_num_pad(e.abroad_postal_code, 10),

      /* פרטי בנק בחו"ל */
      /* 431-433*/ fn_num_pad(CAST(e.bank_foreign_country_code AS CHAR), 3),
      /* 434-463*/ fn_str_l(e.bank_city_foreign, 30),
      /* 464-493*/ fn_str_l(e.bank_street_foreign, 30),
      /* 494-499*/ fn_str_l(e.bank_house_no_foreign, 6),
      /* 500-509*/ fn_str_l(e.bank_code_foreign, 10),
      /* 510-539*/ fn_str_l(e.bank_name_foreign, 30),
      /* 540-549*/ fn_str_l(e.bank_branch_code_foreign, 10),
      /* 550-579*/ fn_str_l(e.bank_branch_name_foreign, 30),
      /* 580-604*/ fn_str_l(e.bank_swift, 25),
      /* 605-644*/ fn_str_l(e.bank_iban, 40),

      /* מוטב */
      /* 645-674*/ fn_str_l(e.beneficiary_last_name, 30),
      /* 675-704*/ fn_str_l(e.beneficiary_first_name, 30)

      /* 705    */  -- אין שדה נוסף; רק דואגים לאורך כולל 705
    ), 705, ' '), 705) AS data_line
  FROM chosen p
  JOIN employees e ON e.id = p.employee_id
  JOIN employers r ON r.id = p.employer_id
  JOIN agency_settings s ON s.id = 1;

END$$

