CREATE DEFINER=`root`@`localhost` PROCEDURE `sp_piba_export_raw` (IN `in_employee_id` BIGINT)   BEGIN
  /* מחזיר שורה “גולמית” ל־PIBA (ליצירת XML בפרונט) מה־placement האחרון */
  SELECT
    'PIBA'               AS export_kind,
    p.id                 AS placement_id,
    p.employee_id,
    p.employer_id,
    e.passport_number    AS passport_number,
    e.first_name         AS employee_first_name,
    e.last_name          AS employee_last_name,
    r.first_name         AS employer_first_name,
    r.last_name          AS employer_last_name,
    NULL                 AS start_date,
    NULL                 AS end_date
  FROM placements p
  JOIN employees  e ON e.id = p.employee_id
  JOIN employers  r ON r.id = p.employer_id
  WHERE p.employee_id = in_employee_id
  ORDER BY p.id DESC
  LIMIT 1;

  IF ROW_COUNT() = 0 THEN
    SELECT
      'PIBA' AS export_kind,
      NULL   AS placement_id,
      in_employee_id AS employee_id,
      NULL   AS employer_id,
      NULL   AS passport_number,
      NULL   AS employee_first_name,
      NULL   AS employee_last_name,
      NULL   AS employer_first_name,
      NULL   AS employer_last_name,
      NULL   AS start_date,
      NULL   AS end_date;
  END IF;
END$$

