CREATE DEFINER=`root`@`localhost` FUNCTION `fn_digits_only` (`val` VARCHAR(255)) RETURNS VARCHAR(255) CHARSET utf8mb4 COLLATE utf8mb4_unicode_ci DETERMINISTIC BEGIN
  DECLARE i INT DEFAULT 1;
  DECLARE c CHAR(1);
  DECLARE res VARCHAR(255) DEFAULT '';
  IF val IS NULL THEN
    RETURN '';
  END IF;
  WHILE i <= CHAR_LENGTH(val) DO
    SET c = SUBSTRING(val, i, 1);
    IF c BETWEEN '0' AND '9' THEN
      SET res = CONCAT(res, c);
    END IF;
    SET i = i + 1;
  END WHILE;
  RETURN res;
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fn_num_pad` (`val` VARCHAR(255), `len` INT) RETURNS VARCHAR(255) CHARSET utf8mb4 COLLATE utf8mb4_unicode_ci DETERMINISTIC BEGIN
  RETURN LEFT(LPAD(fn_digits_only(val), len, '0'), len);
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fn_str_l` (`val` VARCHAR(1000), `len` INT) RETURNS VARCHAR(1000) CHARSET utf8mb4 COLLATE utf8mb4_unicode_ci DETERMINISTIC BEGIN
  -- Left-align text, pad with spaces to exact 'len'
  RETURN LEFT(RPAD(IFNULL(val, ''), len, ' '), len);
END$$

CREATE DEFINER=`root`@`localhost` FUNCTION `fn_str_r` (`val` VARCHAR(1000), `len` INT) RETURNS VARCHAR(1000) CHARSET utf8mb4 COLLATE utf8mb4_unicode_ci DETERMINISTIC BEGIN
  -- Right-align text, pad with spaces to exact 'len'
  RETURN RIGHT(LPAD(IFNULL(val, ''), len, ' '), len);
END$$

